        <li className={ index === 1 ? "current" : "" }><a href="javascript:;">Planos</a></li>
        <li className={ index === 2 ? "current" : "" }><a href="javascript:;" onClickCapture={onClick(2)}>Pagamento</a></li>
        {/*<li className="current"><em>Project</em></li>*/ }
      </ol>
    </nav>
  )
}


export default MultiStepIndicator
